import React,{useState} from 'react'

const Todo = () => {

    const [name, setname] = useState('')
    const onchangeinput =(event)=>{
        setname(event.target.value)
    }

    return (
        <>
            <form action="">
                <input type="text" placeholder="enter your name" value={name} onChange={onchangeinput} />
            </form>
        </>
    )
}

export default Todo
